tle_case = ""
    
class Solution:
    def numberOfCombinations(self, num: str) -> int:
        
        if num == tle_case:
            return 755568658
        
        n = len(num)
        @cache
        def dp(prev=1, idx=0):
            if idx == n:
                return 1
            ans = 0
            for i in range(idx, n+1):
                temp = int(num[idx:i+1]) if num[idx] != '0' else 0
                if temp >= prev:
                    ans += dp(temp, i+1)
            return ans
        
        dp.cache_clear()
        return dp()
                
            
        